import {
  HomeOutlined,
  UserOutlined,
  UserAddOutlined,
  UsergroupAddOutlined,
  SafetyOutlined,
  GiftOutlined
} from "@ant-design/icons";

const sidebar = [
  {
    routeName: "frontend.admin.dashboard.index",
    icon: <HomeOutlined />,
    routeParams: {},
  },
  {
    routeName: "frontend.admin.companies.index",
    icon: <GiftOutlined />,
    routeParams: {}
    // type: "sub",
  },
  {
    routeName: "frontend.admin.memberships.index",
    icon: <SafetyOutlined />,
    routeParams: {}
    // type: "sub",
  },
  {
    routeName: "frontend.admin.adminsIndex",
    icon: <UserOutlined />,
    routeParams: {},
    type: "sub",
    children: [
      {
        routeName: "frontend.admin.adminGroups.index",
        icon: <UsergroupAddOutlined />,
        routeParams: {}
      },
      {
        routeName: "frontend.admin.admins.index",
        icon: <UserAddOutlined />,
        routeParams: {}
      }
    ]
  }
];

export default sidebar;
